let firstNumberCode : String = ""

let secondNumberCode : String = ""

let thirdNumberCode : String = ""

let fourthNumberCode : String = ""

let fifthNumberCode : String = ""

//Covert all our strings of direction into arrays of characters
let firstCollection = Array(firstNumberCode.characters)
let secondCollection = Array(secondNumberCode.characters)
let thirdCollection = Array(thirdNumberCode.characters)
let fourthCollection = Array(fourthNumberCode.characters)
let fifthCollection = Array(fifthNumberCode.characters)

//Create a collection of arratys of characters so we can go through them
var collection = [[Character]]()
collection.append(firstCollection)
collection.append(secondCollection)
collection.append(thirdCollection)
collection.append(fourthCollection)
collection.append(fifthCollection)

//Our default position and an array of resulting ints
var pos = 5
var res = [Int]()

//Method that goes through an array of characters and find the last possition in it, also updates our position for the next time we run it
func findValue(arrayOfChars: Array<Character>) -> Int{
    for index in arrayOfChars {
        if index == "U" {
            if pos > 3 {
                pos = pos - 3
            }
        } else if index == "D" {
            if pos < 7 {
                pos = pos + 3
            }
        } else if index == "L" {
            if pos != 1 && pos != 4 && pos != 7 {
                pos = pos - 1
            }
        } else if index == "R" {
            if pos != 3 && pos != 6 && pos != 9 {
                pos = pos + 1
            }
        }
    }
    return pos
}

for index in collection {
    findValue(arrayOfChars: index)
    res.append(pos)
}

